import React from 'react';
import redFlower from '../images/redFlowers.jpg';

class pastSuccess extends React.Component {
	render() {
		return (
			<div>
					<div class="ui divider"></div>
					<img class="ui fluid image" src={redFlower} />

			</div>
		)
	}
}

export default pastSuccess;
